import React, { useState } from 'react';
import './styles.css';

function App() {
  // State to track which page to show (upload page or results page)
  const [page, setPage] = useState('upload');  // default to 'upload' page

  const handleUpload = () => {
    // When the button is clicked, change page to 'results'
    setPage('results');
  };

  return (
    <div className="container">
      {page === 'upload' ? (
        // Render Upload Page
        <>
          <h1>GeneSight Upload Page</h1>
          <p>Click the button below to upload your files for analysis.</p>
          <input type="file" className="file-input" />
          <button className="upload-button" onClick={handleUpload}>
            Upload Files Here Now
          </button>
        </>
      ) : (
        // Render Results Page
        <>
          <h1>Here's What We Found:</h1>
          <p>Your results will be displayed here!</p>
        </>
      )}
    </div>
  );
}

export default App;
